import React from 'react'
import Footer from '../components/Footer/Footer';
import Aboutpage from '../Pages/Aboutpage/Aboutpage';

const About = () => {
  return (
    <div className='container2'>
        
        <div className='aboutContainer'>
          <Aboutpage/>
          <Footer/>
        </div>
      </div>
  )
}

export default About;
